      });

      tl.set($portfolioCurrent.current, {
        css: { backgroundImage: 'url(' + cursor.cursorImage + ')' },
      });
    }
  }, [cursor.cursorImage, tl, $portfolioNext, $portfolioCurrent]);

  return (
    // Your component JSX
  );
};

export default YourComponent;
```

### Explanation:
1. **useRef**: We use `useRef` to store the timestamp of the last time the effect ran.
2. **Date.now()**: We get the current timestamp using `Date.now()`.
3. **Condition**: We check if the difference between the current timestamp and the last run timestamp is greater than or equal to 600 milliseconds (0.6 seconds).
4. **Update Timestamp**: If the condition is met, we update the `lastRun` ref with the current timestamp and execute the code inside the `useEffect`.

This ensures that the code inside the `useEffect` hook runs only once every 0.6 seconds.

