```

### 2. Inlining
Inlining replaces function calls with the actual function code to eliminate the overhead of function calls.

**Example:**
```c
// Original code
int add(int a, int b) {
    return a + b;
}

int main() {
    int x = 5, y = 10;
    int result = add(x, y);
    return result;
}

